        super(props);
        this.state = {
        };
    }
    render() {
        return (
            <div>
                <ButtonGroup>
                            <DropdownButton id="mainButton" as={ButtonGroup} title="Job Entries" id="bg-nested-dropdown" variant="primary" size="lg" block>
                                <Dropdown.Item eventKey="1">View Job Entry</Dropdown.Item>
                                <Dropdown.Item eventKey="2">Create Job Entry</Dropdown.Item>
                            </DropdownButton>
                        </ButtonGroup>
            </div>
        )}}

export default JobNavBut;
